    } else if (value is List<NIAllNullableTypesWithoutRecursion?> &&
        isTypeOrNullableType<NSMutableArray>(T)) {
      final NSMutableArray res = NSMutableArray();
      for (final NIAllNullableTypesWithoutRecursion? entry in value) {
